contract A{
    uint256[] numberArray;
    function pushdata(uint256 number, uint256 from) external{
        uint256 value = from;
        for(uint i=0; i < number;i++){
            numberArray.push(value);
            value += 1;
        }
    }

    function viewData() external view returns(uint256[] memory){
        return numberArray;
    }

    function viewLength() external view returns(uint256){
        return numberArray.length;
    }

    function viewWithCondition(uint256 a) external view returns(uint256){
        uint256 x;
        for(uint i=0; i < numberArray.length;i++){
            if(a == i){
                x = a;
                break;
            }
            else{
                x = 999999;
            }
        }

        return x;
    }


    function getTotal() external view returns(uint256){
        uint256 result;
        for(uint i=0; i < numberArray.length;i++){
            result += numberArray[i];
        }

        return result;
    }

    function tryReversedLoop(uint256[] calldata a) external{
        //uint256[] memory result;
        for (uint i = a.length; i > 0; i--) {
                numberArray[i] = a[i];
                if(i == 0){
                    break;
                }
            }

    }
}

